/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="${classMap(context.classes.root)}" dir="${ifDefined(context.effectiveDir)}">${ context.tabsAtTheBottom ? block1(context) : undefined }<div class="${classMap(context.classes.header)}" id="${ifDefined(context._id)}-header"><div class="${classMap(context.classes.headerInnerContainer)}"><div class="${classMap(context.classes.headerBackArrow)}"><${scopeTag("ui5-button", tags, suffix)} @click="${context._onHeaderBackArrowClick}" icon="slim-arrow-left" design="Transparent" tabindex="-1" title="${ifDefined(context.previousIconACCName)}"></${scopeTag("ui5-button", tags, suffix)}></div><!-- tab items --><div class="${classMap(context.classes.headerScrollContainer)}" id="${ifDefined(context._id)}-headerScrollContainer"><ul role="tablist" @focusin=${context._onTablistFocusin} class="${classMap(context.classes.headerList)}" @click="${context._onHeaderClick}" @keydown="${context._onHeaderKeyDown}" @keyup="${context._onHeaderKeyUp}">${ repeat(context.items, (item, index) => item._id || index, (item, index) => block4(item, index, context)) }</ul></div><div class="${classMap(context.classes.headerForwardArrow)}"><${scopeTag("ui5-button", tags, suffix)} @click="${context._onHeaderForwardArrowClick}" icon="slim-arrow-right" design="Transparent" tabindex="-1" title="${ifDefined(context.nextIconACCName)}"></${scopeTag("ui5-button", tags, suffix)}></div></div><!-- overflow button -->${ context.shouldShowOverflow ? block7(context) : undefined }</div>${ !context.tabsAtTheBottom ? block10(context) : undefined }</div> `; };
const block1 = (context) => { return html`<div class="${classMap(context.classes.content)}">${ repeat(context.items, (item, index) => item._id || index, (item, index) => block2(item, index, context)) }</div>`; };
const block2 = (item, index, context) => { return html`${ !item.isSeparator ? block3(item, index, context) : undefined }`; };
const block3 = (item, index, context) => { return html`<div class="ui5-tc__contentItem" id="ui5-tc-contentItem-${ifDefined(item._posinset)}" ?hidden="${item.effectiveHidden}" role="tabpanel" aria-labelledby="${ifDefined(item._id)}"><slot name="${ifDefined(item._individualSlot)}"></slot></div>`; };
const block4 = (item, index, context) => { return html`${ !item.isSeparator ? block5(item, index, context) : undefined }${ item.isSeparator ? block6(item, index, context) : undefined }`; };
const block5 = (item, index, context) => { return html`${ifDefined(item.stripPresentation)}`; };
const block6 = (item, index, context) => { return html`<li id="${ifDefined(item._id)}" role="separator" class="${classMap(context.classes.separator)}" style="list-style-type: none;"></li>`; };
const block7 = (context) => { return html`<div class="ui-tc__overflowButton" @click="${context._onOverflowButtonClick}">${ context.overflowButton.length ? block8(context) : block9(context) }</div>`; };
const block8 = (context) => { return html`<slot name="overflowButton"></slot>`; };
const block9 = (context) => { return html`<${scopeTag("ui5-button", tags, suffix)} icon="${ifDefined(context.overflowMenuIcon)}" design="Transparent" tabindex="-1" title="${ifDefined(context.overflowMenuTitle)}" aria-haspopup="true"></${scopeTag("ui5-button", tags, suffix)}>`; };
const block10 = (context) => { return html`<div class="${classMap(context.classes.content)}">${ repeat(context.items, (item, index) => item._id || index, (item, index) => block11(item, index, context)) }</div>`; };
const block11 = (item, index, context) => { return html`${ !item.isSeparator ? block12(item, index, context) : undefined }`; };
const block12 = (item, index, context) => { return html`<div class="ui5-tc__contentItem" id="ui5-tc-contentItem-${ifDefined(item._posinset)}" ?hidden="${item.effectiveHidden}" role="tabpanel" aria-labelledby="${ifDefined(item._id)}"><slot name="${ifDefined(item._individualSlot)}"></slot></div>`; };


	return block0(context);
};

export default main;
